import React from "react"


export default function ToDoList(props){
    const groupElements = props.group.map((group, index) => (
        <div key={group.id}>
            <div
                className={`title ${
                    group.id === props.currentNote.id ? "selected-group" : ""
                }`}
                onClick={() => props.setCurrentNoteId(group.id)}
            >
                <h4 className="text-snippet">{group.title}</h4>
            </div>
        </div>
    ))
    return(
        <section>
            <div>
                {groupElements}
                <button>+</button>
            </div>
        </section>
    )
}

const groupElements = props.notes.map((group, index) => (
    <div key={group.id}>
        <div
            
            className={`title ${
                group.id === props.currentNote.id ? "selected-group" : ""
            }`}
            onClick={() => props.setCurrentNoteId(group.id)}
        >
            <h4 className="text-snippet">Note {index + 1}</h4>
        </div>
    </div>
))
